import PropTypes from 'prop-types';


function PersonInfo() {
    return (
        <>
            {personInfo && (
                <ul>
                    {personInfo.map(({ title, data }) => (
                        data && (
                            <li key={title}>
                                <span>{title}: {data}</span>
                            </li>
                        )
                    ))}
                </ul>
            )}
        </>
    );
}

PersonInfo.propTypes = {
    people: PropTypes.array
}

export default PersonInfo;
